import React from 'react';
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

import Home from "./Home/homepage.jsx";

function App() {
  return (
    <Router>
      <header>
        <nav>
            <ul>
                <li>
                    <Link to="/">Home</Link>
                </li>
            </ul>
        </nav>
      </header>
        <Switch>
            <Route path="/" component={Home}></Route>
        </Switch>
    </Router>
  );
}

export default App;
